import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom"
import { useEffect } from 'react';
import But from "./components/but/but";
import Tak from "./components/index/index";

function RoutesMenu() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Tak />} />
          <Route path='/tak' element={<But />} />
        </Routes>
      </BrowserRouter>
    </>
  )
}

export default Routes;
